$(document).on("ready",function(){$(document,this).on("click",".delete-button",function(e){e.preventDefault();var t=$(this),n=t.attr("href"),o=t.parent();Swal.fire({title:"Are you sure?",text:"You won't be able to revert this!",icon:"warning",showCancelButton:!0,confirmButtonColor:"#3085d6",cancelButtonColor:"#d33",confirmButtonText:"Yes, delete it!"}).then(r=>{r.isConfirmed&&$.ajax({url:n,method:"DELETE",success:function(i){o.remove()}})})})});
